import React from "react"
import Data from "./Data"
import Card from "./Card"
import Navbar from "./Navbar"



export default function App() {
    const Directory = Data.map(item => {
        return <Card 
			{...item}
		    />})

    return (
        <>
        <Navbar/>
        <div className="contacts">
                {Directory}    
        </div>
        </>
    )
}
